import React, { useState } from 'react'
import { List, ListItem, ListItemText, ListItemAvatar, Typography, Avatar } from '@mui/material'

const Contacts = ({ contacts, current, currentChatter }) => {
    const [currentSelected, setCurrentSelected] = useState(null);

    const changeCurrentChat = (index, contact) => {
        setCurrentSelected(index);
        currentChatter(contact);
    };

    console.log(contacts)

    return (
        <List sx={{ width: "100%", bgcolor: "white" }}>
            <ListItem alignItems="flex-start">
        <ListItemAvatar>
          <Avatar alt="Remy Sharp" src="/static/images/avatar/1.jpg" />
        </ListItemAvatar>
        <ListItemText
          primary="Brunch this weekend?"
          secondary={
            <React.Fragment>
              <Typography
                sx={{ display: 'inline' }}
                component="span"
                variant="body2"
                color="text.primary"
              >
                Ali Connors
              </Typography>
              {" — I'll be in your neighborhood doing errands this…"}
            </React.Fragment>
          }
        />
      </ListItem>
            {contacts.map((contact, index) => {
                <ListItem alignItems="flex-start" onClick={() => changeCurrentChat(index, contact)}>
                    <ListItemAvatar>
                        <Avatar alt={`${contact.username}`} src={`${contact.avatar}`} />
                    </ListItemAvatar>
                    <ListItemText
                        primary={`${contact.username}`}
                    />
                </ListItem>
            })}
        </List>
    )
}

export default Contacts
